const Index = () => {
    return (
            <main className="main">
                <div>
                    <p>This site is still under construction and might not be up for some time.</p>
                    <p>Name: Raghav Sharma</p>
                    <p>Place: Toronto, Ontario</p>
                </div>
            </main>);
}

export default Index;
